// SPDX-License-Identifier: UNLICENSE
pragma solidity 0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Traceability is Ownable {
    // Event declarations
    event RoleAndUserSet(address indexed user, uint256 roleId, string subjectName);
    event BasicTraceDataAdded(string indexed product_id, string user_id, uint256 process_date, string location_name, string location_address);
    event ProducerTraceDataAdded(string indexed product_id, string user_id, string product_type, uint256 expiry_date, string location_name, string location_address);

    mapping(address => uint256) public UserRole; // 0 = general, 1 = supplier, 2 = producer, 3 = wholeseller, 4 = smallseller
    mapping(address => string) public SubjectName;

    struct TraceData {
        string user_id;
        address user_address;
        string product_id;
        uint256 process_date;
        string location_name;
        string location_address;
        string[] src_product_id;

        // Additional fields for producer
        string product_type;
        uint256 expiry_date;
    }

    mapping(string => TraceData) public TraceDataMap;

    constructor() Ownable(msg.sender) {}

    function setRoleAndUser(address _user, uint256 _roleId, string memory _subjectName) public onlyOwner {
        UserRole[_user] = _roleId;
        SubjectName[_user] = _subjectName;
        emit RoleAndUserSet(_user, _roleId, _subjectName);
    }

    function addBasicTraceData(
        string memory _product_id,
        uint256 _process_date,
        string memory _location_name,
        string memory _location_address,
        string[] memory _src_product_id,
        string memory _product_type,
        uint256 _expiry_date
    ) public {
        require(UserRole[msg.sender] != 0 && UserRole[msg.sender] < 5, "User must have a valid role id");
        //require(UserRole[msg.sender] != 2, "Producer should use addProducerTraceData");


        if(UserRole[msg.sender] != 2){
            _product_type = "";
            _expiry_date = 0;

        }

        TraceDataMap[_product_id] = TraceData({
            user_id: SubjectName[msg.sender],
            user_address: msg.sender,
            product_id: _product_id,
            process_date: _process_date,
            location_name: _location_name,
            location_address: _location_address,
            src_product_id: _src_product_id,
            product_type: _product_type,
            expiry_date: _expiry_date
        });

        emit BasicTraceDataAdded(_product_id, SubjectName[msg.sender], _process_date, _location_name, _location_address);

        if(UserRole[msg.sender] == 2){
            emit ProducerTraceDataAdded(_product_id, SubjectName[msg.sender], _product_type, _expiry_date, _location_name, _location_address);
        }
    }

/*
    function addProducerTraceData(
        string memory _product_id,
        uint256 _process_date,
        string memory _location_name,
        string memory _location_address,
        string[] memory _src_product_id,
        string memory _product_type,
        string memory _expiry_date
    ) public {
        require(UserRole[msg.sender] == 2, "Only Producer can use this function");

        TraceDataMap[_product_id] = TraceData({
            user_id: SubjectName[msg.sender],
            user_address: msg.sender,
            product_id: _product_id,
            process_date: _process_date,
            location_name: _location_name,
            location_address: _location_address,
            src_product_id: _src_product_id,
            product_type: _product_type,
            expiry_date: _expiry_date
        });

        emit ProducerTraceDataAdded(_product_id, SubjectName[msg.sender], _product_type, _expiry_date, _location_name, _location_address);
    }
*/
    function getTraceData(string memory _product_id) public view returns (
        string memory user_id,
        address user_address,
        string memory product_id,
        uint256 process_date,
        string memory location_name,
        string memory location_address,
        string memory product_type,
        uint expiry_date
    ) {
        TraceData memory data = TraceDataMap[_product_id];
        return (
            data.user_id,
            data.user_address,
            data.product_id,
            data.process_date,
            data.location_name,
            data.location_address,
            data.product_type,
            data.expiry_date
        );
    }
}

